import React from 'react';
import './App.css';
import HomePage from './pages/homepage.component';
import { Router, Switch } from 'react-router-dom';


const HatsPage = () => (
  <h1>HATS PAGE</h1>
)

function App() {
  return (
    <div>
    <Switch>
      <Router exact route='/' component={HomePage}/>
      <Router route='/hats' component={HatsPage} />
    </Switch>

    </div>
  );
}

export default App;
